webpackJsonp([0xb8b748f3444a],{304:function(e,n){e.exports={data:{site:{siteMetadata:{title:"Annalisa Valente"}},contentfulPageSelectorPanel:{pages:[{name:"PD Spellbook",title:"PD Spellbook",slug:"/projects/pd-spellbook",description:"Glossary of terms for product people, side project"},{name:"IBM ",title:"IBM",slug:"/projects/IBM/",description:"Product designer in the product team of IBM AIOps"},{name:"Google",title:"Google",slug:"/projects/google/",description:"Interaction Designer Contractor in the Google Play Console team"},{name:"The Telegraph Puzzle ",title:null,slug:"/projects/the-telegraph-puzzle/",description:"Redesign the experience of the Telegraph Puzzle website"},{name:"Mindfulness Moments",title:"Mindfulness Moments",slug:"/projects/mindfulness-moments/",description:"Building a new fundraising proposition"},{name:"Mighty Hikes",title:null,slug:"/projects/mighty-hikes",description:"Building a digital fundraising proposition experience"},{name:"Nectar ",title:"Nectar",slug:"/projects/nectar/",description:"  New way of discovering Nectar brands for web and iOS-Android "},{name:"Lloyds Banking Group",title:"Lloyds Banking Group",slug:"/projetcs/lloyds-banking-group",description:"Consultant in the Personalised interactions, Mobile team"},{name:"Local Cancer Intelligence",title:"Local Cancer Intelligence",slug:"/projects/local-cancer-intelligence/",description:"New LCI website"},{name:"MyMail & Nectar",title:"MyMail & Nectar",slug:"/projects/mymail-and-nectar/",description:"Launch of MyMail and Nectar proposition"},{name:"Calvin Klein",title:"Calvin Klein",slug:"/projects/calvin-klein/",description:"Designing microsite for Calvin Klein Italy"},{name:"The Telegraph apps",title:"The Telegraph",slug:"/projects/the-telegraph/",description:"Working on various digital newspaper touch points"},{name:"Emoji and depression",title:null,slug:"/projects/emoji-and-depression",description:"Detect depression in young people "}]},contentfulPage:{slug:"/projects/local-cancer-intelligence/",password:null,panels:[{__typename:"ContentfulHeaderPanel",text:"Local Cancer Intelligence"},{__typename:"ContentfulContentPanel",content:{content:"> __My role:__ UX Lead\n> \n> __Timeframe:__ 2 month\n\n__Project__ \nLocal Cancer Intelligence helps professionals understand the changing cancer population within a Clinical Commissioning Group (CCG) in England. It also shows how this compares within Cancer Alliances for some of the data sets available on the tool.\n\nThanks to an increase of the mobile use from av of 5% up to nearly 30% later in the year, we focused on improving the UX on the mobile experience.\n\nWe conducted a redisign of website to:\n- Improve search and filtering\n- Improve mobile experience\n- Meet KPIs - reduce time on task \n\n__Users__\nOur users demographic are students and NHS professional between 20-50 years old. \n\n__Approach__\nAfter kick off and design exploration workshops with stakeholders I've created a new proposal mocks, flows and a prototye. I've made a prototype and I've conducted usability test with users. \n",childMarkdownRemark:{html:"<blockquote>\n<p><strong>My role:</strong> UX Lead</p>\n<p><strong>Timeframe:</strong> 2 month</p>\n</blockquote>\n<p><strong>Project</strong>\nLocal Cancer Intelligence helps professionals understand the changing cancer population within a Clinical Commissioning Group (CCG) in England. It also shows how this compares within Cancer Alliances for some of the data sets available on the tool.</p>\n<p>Thanks to an increase of the mobile use from av of 5% up to nearly 30% later in the year, we focused on improving the UX on the mobile experience.</p>\n<p>We conducted a redisign of website to:</p>\n<ul>\n<li>Improve search and filtering</li>\n<li>Improve mobile experience</li>\n<li>Meet KPIs - reduce time on task </li>\n</ul>\n<p><strong>Users</strong>\nOur users demographic are students and NHS professional between 20-50 years old. </p>\n<p><strong>Approach</strong>\nAfter kick off and design exploration workshops with stakeholders I've created a new proposal mocks, flows and a prototye. I've made a prototype and I've conducted usability test with users. </p>"}}},{__typename:"ContentfulImagePanel",fullWidth:null,media:{description:"",file:{url:"//images.ctfassets.net/wk0hltq7eofw/BxKGSpTdxcU5VubPfsPt5/e6c00a9dca909e462e38d2daca6b4ca0/Screen_Shot_2019-02-12_at_00.22.06.png"}}},{__typename:"ContentfulContentPanel",content:{content:"__Prototype and mobile experience__\n\nI've created two prototypes (desktop and mobile) with [principle](http://principleformac.com/) ready to be tested with the users. \n\nI've conducted usability test with students and NHS professionals. ",childMarkdownRemark:{html:"<p><strong>Prototype and mobile experience</strong></p>\n<p>I've created two prototypes (desktop and mobile) with <a href=\"http://principleformac.com/\">principle</a> ready to be tested with the users. </p>\n<p>I've conducted usability test with students and NHS professionals. </p>"}}},{__typename:"ContentfulImagePanel",fullWidth:!1,media:{description:"",file:{url:"//images.ctfassets.net/wk0hltq7eofw/xh3STcVBKKcGWaMK6WYUc/ff37cd1d3fdb144972c546fcc7dac62b/lci.gif"}}},{__typename:"ContentfulImagePanel",fullWidth:null,media:{description:"",file:{url:"//images.ctfassets.net/wk0hltq7eofw/2NtihJvJqLZs93IUOu2LNt/20278287d5f5a278181c78a2d3223278/lci.jpg"}}},{__typename:"ContentfulContentPanel",content:{content:"__User testing__\n\n",childMarkdownRemark:{html:"<p><strong>User testing</strong></p>"}}},{__typename:"ContentfulImagePanel",fullWidth:null,media:{description:"",file:{url:"//images.ctfassets.net/wk0hltq7eofw/7HrrzBrt1FiKbh1kiNmoKA/11bffd04cfc8f2a971f7dacc51b0dcf5/Screen_Shot_2019-02-12_at_00.30.53.png"}}},{__typename:"ContentfulContentPanel",content:{content:"__Result__\n\n- 7 participants could complete the tasks\n- 7 participants could reset the filters with no hesitation and deviation.\n- 6 participants find the filters clear and easier to use.\n\n\nThe website was developed by a dev squad and it is live here:  https://lci.macmillan.org.uk/England/",childMarkdownRemark:{html:'<p><strong>Result</strong></p>\n<ul>\n<li>7 participants could complete the tasks</li>\n<li>7 participants could reset the filters with no hesitation and deviation.</li>\n<li>6 participants find the filters clear and easier to use.</li>\n</ul>\n<p>The website was developed by a dev squad and it is live here:  <a href="https://lci.macmillan.org.uk/England/">https://lci.macmillan.org.uk/England/</a></p>'}}}]}},pathContext:{slug:"/projects/local-cancer-intelligence/",p:"35675e68f4b5af7b995d9205ad0fc43842f16450"}}}});
